import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header-container">
        <div className="logo">
          <h1>远程工作</h1>
        </div>
        <nav className="nav">
          <a href="/" className="nav-link">工作机会</a>
          <a href="/companies" className="nav-link">公司</a>
          <a href="/profile" className="nav-link">个人中心</a>
        </nav>
      </div>
    </header>
  );
};

export default Header;
